package
    Getopt;

use strict;
use warnings;

BEGIN {
    $INC{"Getopt.pm"} = __FILE__;
}

my @options = (
    'backend-collect-timeout=i',
    'ca-cert-file=s',
    'clean',
    'color',
    'cron=i',
    'debug|d=i',
    'distro=s',
